import React, { Component, Fragment } from 'react';
import logo from './logo.svg';
import './App.css';

/* function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
} */

export default class App extends React.Component {

	state = {
		loading: true,
		drug: null
	};

	async componentDidMount() {
		const url = "https://drugtargetcommons.fimm.fi/api/data/bioactivity/?format=json";
		const response = await fetch(url);
		const data = await response.json();
		this.setState({ drug: data.bioactivities[0], loading: false });
		//console.log(data.bioactivities[0]);
	}

	render(){
		if (this.state.loading) {
			return <div>loading...</div>; 
		}

		if (!this.state.drug) {
			return <div>didnt get a drug</div>;
		}

		return (
			<Fragment>
			<div>
				<div>{this.state.drug.activity_comment}</div>
				<div>{this.state.drug.annotated}</div>
				<div>{this.state.drug.annotation_comments}</div>
				<div>{this.state.drug.assay_cell_type}</div>
				<div>{this.state.drug.assay_format}</div>
				<div>{this.state.drug.assay_sub_type}</div>
				<div>{this.state.drug.assay_type}</div>
				<div>{this.state.drug.authors}</div>
				<div>{this.state.drug.chembl_id}</div>
				<div>{this.state.drug.compound_concentration_value}</div>
				<div>{this.state.drug.compound_concentration_value_unit}</div>
				<div>{this.state.drug.compound_name}</div>
				<div>{this.state.drug.detection_technology}</div>
				<div>{this.state.drug.endpoint_actionmode}</div>
				<div>{this.state.drug.endpoint_standard_relation}</div>
				<div>{this.state.drug.endpoint_standard_type}</div>
				<div>{this.state.drug.endpoint_standard_units}</div>
				<div>{this.state.drug.endpoint_standard_value}</div>
				<div>{this.state.drug.gene_name}</div>
				<div>{this.state.drug.inhibitor_type}</div>
				<div>{this.state.drug.max_phase}</div>
				<div>{this.state.drug.mutation_info}</div>
				<div>{this.state.drug.protein_class}</div>
				<div>{this.state.drug.pubmed_id}</div>
				<div>{this.state.drug.resource_uri}</div>
				<div>{this.state.drug.target_organism}</div>
				<div>{this.state.drug.target_pref_name}</div>
				<div>{this.state.drug.uniprot_id}</div>
				<div>{this.state.drug.wildtype_or_mutant}</div>
			</div>

			<table class="table">
				<thead>
					<tr>
					  <th scope="col">#</th>
					  <th scope="col">First</th>
					  <th scope="col">Last</th>
					  <th scope="col">Handle</th>
					</tr>
				</thead>
				<tbody>
					<tr>
					  <th scope="row">1</th>
					  <td>Mark</td>
					  <td>Otto</td>
					  <td>@mdo</td>
					</tr>
					<tr>
					  <th scope="row">2</th>
					  <td>Jacob</td>
					  <td>Thornton</td>
					  <td>@fat</td>
					</tr>
					<tr>
					  <th scope="row">3</th>
					  <td>Larry</td>
					  <td>the Bird</td>
					  <td>@twitter</td>
					</tr>
				  </tbody>
			</table>
			</Fragment>

		);
	}
}
